            WriteLiteral(@"
        <script>

            const hubConnection = new signalR.HubConnectionBuilder()
                .withUrl(""/chat"")
                .build();
            hubConnection.on(""ReceiveUser"", function (message, userName)//устанавливает метод на стороне клиента,
            //который будет получать данные от сервера
            {
                let date = new Date()
                let day = date.getDate();
                let month = date.getMonth() + 1;
                let year = date.getFullYear();
                let hour = date.getHours();
                let min = date.getMinutes();
                let sec = date.getSeconds();

                let fullDate = `${day}.${month}.${year}  ${hour}:${min}:${sec}`;

                // создаем элемент <b> для имени пользователя
                let userNameElem = document.createElement(""b"");
                userNameElem.appendChild(document.createTextNode(userName + "": ""));

                // создает элемент <p> для сообщения пользователя");
            WriteLiteral(@"
                let elem = document.createElement(""p"");
                elem.appendChild(userNameElem);
                elem.appendChild(document.createTextNode(message));
                elem.appendChild(document.createElement(""br""));
                elem.appendChild(document.createTextNode(fullDate));
                elem.className = ""message""

                var firstElem = document.getElementById(""chatroom"").lastChild;
                document.getElementById(""chatroom"").insertBefore(elem, firstElem);
            });

            hubConnection.on(""Notify"", function (message) {

                // создает элемент <p> для сообщения пользователя
                let elem = document.createElement(""p"");
                elem.appendChild(document.createTextNode(message));

                var firstElem = document.getElementById(""chatroom"").lastChild;
                document.getElementById(""chatroom"").insertBefore(elem, firstElem);
            });


            // отправка сообщения на серв");
            WriteLiteral(@"ер
            document.getElementById(""sendBtn"").addEventListener(""click"", function (e) {
                let message = document.getElementById(""message"").value;
                let to = document.getElementById(""receiver"").value;
                hubConnection.invoke(""SendToUser"", message, to);//первый параметр которого представляет метод хаба,
                //обрабатывающий данный запрос,
                //а второй параметр - данные, отправляемые на сервер
                var block = document.getElementById(""chatroom"");
                block.scrollTop = block.scrollHeight;
            });
            hubConnection.start();
        </script>
    


